const image = new Image();
/* #region image in base64  */
image.src = 'data:image/jpeg;base64,'
/* #endregion */

image.addEventListener('load', function () {
    const canvas = document.getElementById('canvas1');
    const ctx = canvas.getContext('2d')
    canvas.width = 532;
    canvas.height = 677;
    const gradient = ctx.createLinearGradient(0, 0, canvas.width, canvas.height);
    gradient.addColorStop('0.2', 'white');
    gradient.addColorStop('0.3', 'red');
    gradient.addColorStop('0.4', 'orange');
    gradient.addColorStop('0.5', 'yellow');
    gradient.addColorStop('0.6', 'green');
    gradient.addColorStop('0.7', 'turquoise');
    gradient.addColorStop('0.8', 'violet');

    const letters = ['G', 'I', 'T', 'G', 'U', 'D'];
    let switcher = 1;
    let counter = 0;
    setInterval(function() {
        counter++;
        if (counter % 12 === 0) {
            switcher *= -1; // switches between 1 and -1
        }
    }, 500);

    ctx.drawImage(image, 0, 0, canvas.width, canvas.height);
    const pixels = ctx.getImageData(0, 0, canvas.width, canvas.height);
    ctx.clearRect(0, 0, canvas.width, canvas.height);

    let particleArray = [];
    const numOfParticles = 3000;

    let mappedImage = [];
    for (let y = 0; y < canvas.height; y++) {
        let row = [];
        for (let x = 0; x < canvas.width; x++) {
            const red = pixels.data[(y * 4 * pixels.width) + (x * 4)];
            const green = pixels.data[(y * 4 * pixels.width) + (x * 4 + 1)];
            const blue = pixels.data[(y * 4 * pixels.width) + (x * 4 + 2)];
            const brightness = calculateRelativeBrightness(red, green, blue);
            const cell = [
                cellbrightness = brightness,
                cellColor = 'rgb(' + red + ',' + green + ',' + blue + ')'
            ];
            row.push(cell);
        }
        mappedImage.push(row);
    }
    console.log(mappedImage);

    function calculateRelativeBrightness(red, green, blue) {
        return Math.sqrt(
            (red * red) * 0.299 +
            (green * green) * 0.587 +
            (blue * blue) * 0.114
        ) / 100;
    }

    class Particle {
        constructor() {
            this.x = Math.random() * canvas.width;
            this.y = 0;
            // Bottom to top start positions
            //this.x = Math.random() * canvas.width;
            //this.y = canvas.height -1;
            // Left to right start positions
            //this.x = 0;
            //this.y = Math.random() * canvas.height;
            this.speed = 0;
            this.velocity = Math.random() * 1.5;
            this.size = Math.random() * 0.8 + 1;
            this.pos1 = Math.floor(this.y);
            this.pos2 = Math.floor(this.x);
            this.angle = 0;
            this.letter = letters[Math.floor(Math.random() * letters.length)];
            this.random = Math.random();
        }
        update() {
            this.pos1 = Math.floor(this.y);
            this.pos2 = Math.floor(this.x);
            // Check that x and y positions are inside the image dimensions
            if ((mappedImage[this.pos1])&&(mappedImage[this.pos1][this.pos2])) {
                this.speed = mappedImage[this.pos1][this.pos2][0];
            }
            let movement = (2 - this.speed) + this.velocity;
            this.angle += this.speed / 80;
            this.size = this.speed / 1.5;

            //if (switcher === 1) {
            //    ctx.globalCompositeOperation = 'hard-light';
            //} else {
            //    ctx.globalCompositeOperation = 'luminosity';
            //}
            //if (counter % 10 === 0) {
            //    this.x = this.random * canvas.width;
            //    this.y = 0;
            //}

            this.y += movement + Math.sin(this.angle) * 2;
            this.x += movement + Math.cos(this.angle) * 2;
            if (this.y >= canvas.height) {
                this.x = this.random * canvas.width;
                this.y = 0;
            }
            if (this.x >= canvas.width) {
                this.x = 0;
                this.y = this.random * canvas.height;
            }

            // Bottom to top movement
            //this.y -= movement;
            //if (this.y <= 0) {
            //    this.y = canvas.height -1;
            //    this.x = Math.random() * canvas.width;
            //}

            // Left to right movement
            //this.x += movement
            //if (this.x >= canvas.width) {
            //    this.x = 0;
            //    this.y = Math.random() * canvas.height;
            //}
        }
        draw() {
            ctx.beginPath();
            if ((mappedImage[this.pos1])&&(mappedImage[this.pos1][this.pos2])) {
                // particle color matches original image
                ctx.fillStyle = mappedImage[this.pos1][this.pos2][1]; 
                //ctx.fillStyle = gradient;
                //ctx.strokeRect(this.x, this.y, this.size * 2, this.size * 2);
                //ctx.strokeStyle = mappedImage[this.pos1][this.pos2][1];
                //ctx.strokeStyle = gradient;
            } // draw letters at random
            if (this.random < 0.1) ctx.fillText(this.letter, this.x, this.y);
            else ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
            ctx.fill();
        }
    }
    function init() {
        for (let i = 0; i < numOfParticles; i++) {
            particleArray.push(new Particle);
        }
    }
    init();
    function animate() {
        ctx.globalAlpha = 0.05;
        ctx.fillStyle = 'rgb(0,0,0)'; // background color
        ctx.fillRect(0, 0, canvas.width, canvas.height);
        ctx.globalAlpha = 0.2;
        for (let i = 0; i < numOfParticles; i++) {
            particleArray[i].update();
            //ctx.globalAlpha = particleArray[i].speed * 0.3;
            ctx.globalAlpha = 1;
            particleArray[i].draw();
        }
        requestAnimationFrame(animate);
    }
    animate();

});
